import React from 'react';
import { Link } from 'react-scroll';

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg fixed-top">
      <div className="container">
        <a className="navbar-brand" href="/">My Portfolio</a>
        <button
          className="navbar-toggler btn-outline-light"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
          style={{ borderColor: '#58a6ff' }}
        >
          <span className="navbar-toggler-icon" />
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            {['Career Objective', 'Technical Skills', 'Education', 'Professional Development', 'Work Experience', 'References'].map(section => (
              <li className="nav-item" key={section}>
                <Link
                  activeClass="active"
                  to={section.replace(/\s+/g, '').toLowerCase()}
                  spy={true}
                  smooth={true}
                  offset={-75}
                  duration={500}
                  className="nav-link"
                  style={{ cursor: 'pointer' }}
                >
                  {section}
                </Link>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
